import React, { Component } from 'react'
import './App.css'
import Keypad from './components/Keypad'
import ResultComponent from './components/ResultComponent'

export default class App extends Component {
  render() {
    return (
      <div>
        <div className='calculator-margin'>
          <ResultComponent/>
          <Keypad/>
        </div>
      </div>
    )
  }
}
